

import "./Animation_Pixel.scss"
import React, { useEffect, useRef, useState } from 'react';

let windowResize = window.innerWidth;

let mySizeWidth;
let mySizeHeight;


if (windowResize <= 400) {
  mySizeWidth = 0.4/0.9;
  mySizeHeight = 0.3;
} else if (windowResize <= 480) {
  mySizeWidth = 0.3 / 0.9;
  mySizeHeight = 0.3;
} else if (windowResize <= 1050) {
  mySizeWidth = 0.2 / 0.8;
  mySizeHeight = 0.2 / 0.8;
} else if (windowResize >= 1050) {
  mySizeWidth = 0.5;
  mySizeHeight = 0.2 / 0.8;
}

let myRadiysX;
let myRadiysY;

if(windowResize >=1500){
  myRadiysX = - (-60);
  myRadiysY = - (-90);
}else if(windowResize >=1400){
  myRadiysX = - (-60);
  myRadiysY = - (-80);
}else if(windowResize >= 1300){
  myRadiysX = - (-80);
  myRadiysY = - (-90);
}else if (windowResize >= 1100){
  myRadiysX = - (-80);
  myRadiysY = - (-40);
} else if (windowResize >= 1000){
  myRadiysX = - (-10);
  myRadiysY = - 0;
}else if (windowResize >= 900){
  myRadiysX = - 0;
  myRadiysY = - 30;
}else if (windowResize >= 800){
  myRadiysX = -0;
  myRadiysY = -40;
}else if (windowResize >= 700){
  myRadiysX = -0;
  myRadiysY = -0;
}else if (windowResize >= 600){
  myRadiysX = -0;
  myRadiysY = - 0;
}else if (windowResize >= 500){
  myRadiysX = -0;
  myRadiysY = -0;
}else if (windowResize >= 400){
  myRadiysX = -0;
  myRadiysY = -10;
}else if (windowResize >= 300){
  myRadiysX = -0;
  myRadiysY = - (-30);
}
function CanvasAnimation() {
    const canvasRef = useRef(null);
    const imageRef = useRef(null);
    const [isVisible, setIsVisible] = useState(false);
  
    useEffect(() => {
      const canvas = canvasRef.current;
      const ctx = canvas.getContext('2d');
  
      canvas.width = window.innerWidth;
      canvas.height = window.innerHeight;
  
      const gap = 4;
      const mouse = {
        radius: 3000,
        x: undefined,
        y: undefined,
      };
  
      const particlesArray = [];
  
      const image = imageRef.current;
      const centerX = canvas.width * Number(mySizeWidth);
      const centerY = canvas.height * Number(mySizeHeight);
      const x = centerX - image.width * 0.5;
      const y = centerY - image.height * 0.5;

  
      window.addEventListener('mousemove', (event) => {
        mouse.x = event.x - myRadiysX;
        mouse.y = event.y - myRadiysY;
      });
  
      window.addEventListener('touchmove', function (event) {
        if (event.touches.length > 0) {
          mouse.x = event.touches[0].clientX - myRadiysX;
          mouse.y = event.touches[0].clientY - myRadiysY;
        }
      });

      const observer = new IntersectionObserver(
        ([entry]) => {
          setIsVisible(entry.isIntersecting);
        },
        { threshold: 0.5 } // Якщо більше 50% видимості, вважати елемент видимим
      );
  
      observer.observe(canvas);
  
      function init(context) {
        const scaleFactor = Math.min(canvas.width / image.width, canvas.height / image.height) * 1.4;
        context.drawImage(image, x, y, image.width * scaleFactor, image.height * scaleFactor);
  
        const pixels = context.getImageData(0, 0, canvas.width, canvas.height).data;

        
        for (let y = 0; y < canvas.height; y += gap) {
          for (let x = 0; x < canvas.width; x += gap) {
            const index = (y * canvas.width + x) * 4;
            const red = pixels[index];
            const green = pixels[index + 1];
            const blue = pixels[index + 2];
            const alpha = pixels[index + 3];
            const color = 'rgb(' + red + ',' + green + ',' + blue + ')';
  
            if (alpha > 0) {
              particlesArray.push({
                x: Math.random() * canvas.width,
                y: Math.random() * canvas.height,
                originX: Math.floor(x),
                originY: Math.floor(y),
                color,
                size: 2.5,
                vx: 0,
                vy: 0,
                ease: 0.05,
                friction: 0.90,
                dx: 0,
                dy: 0,
                distance: 0,
                fourse: 0,
                angle: 0,
              });
            }
          }
        }
      }
  
      function drawParticle(particle, context) {
        context.fillStyle = particle.color;
        context.fillRect(particle.x, particle.y, particle.size, particle.size);
      }
  
      function updateParticle(particle) {
        particle.dx = mouse.x - particle.x;
        particle.dy = mouse.y - particle.y;
        particle.distance = particle.dx * particle.dx + particle.dy * particle.dy;
        particle.fourse = -mouse.radius / particle.distance;
  
        if (particle.distance < mouse.radius) {
          const angle = Math.atan2(particle.dy, particle.dx);
          particle.vx += particle.fourse * Math.cos(angle);
          particle.vy += particle.fourse * Math.sin(angle);
        }
  
        particle.x += (particle.vx *= particle.friction) + (particle.originX - particle.x) * particle.ease;
        particle.y += (particle.vy *= particle.friction) + (particle.originY - particle.y) * particle.ease;
      }
  
      function draw(context) {
        particlesArray.forEach((particle) => drawParticle(particle, context));
      }
  
      function update() {
        particlesArray.forEach(updateParticle);
      }
  
      init(ctx);
  
       function animate() {
      if (isVisible) {
        ctx.clearRect(0, 0, canvas.width, canvas.height);
        draw(ctx);
        update();
      }

      requestAnimationFrame(animate);
    }

    animate();

    return () => {
      observer.disconnect();
    };
  }, [canvasRef, imageRef, isVisible]);

    return(
        <section>
            <canvas id="canvas1" ref={canvasRef}></canvas>
    <img id="image1" ref={imageRef} src="data:image/png;base64," alt=""></img>
        </section>
    );
}
export default CanvasAnimation;